import React from 'react';
import { useNavigate } from 'react-router-dom';

function LoginPage (){
    const navigate = useNavigate();

    const handlecatergory = () => {
      navigate('/categorypage'); 
  return (
    <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', minHeight: '100vh' }}>
      <form>
        <div style={{
          textAlign: 'center',
          border: '2px solid black',
          borderRadius: '20px',
          backgroundColor: 'antiquewhite',
          height: '300px',
          width: '300px',
          padding: '20px',
        }}>
          <h2>Login</h2>
          <div style={{ marginBottom: '10px' }}>
            <label>
              User Name:
              <input type="text" required style={{ marginLeft: '10px' }} />
            </label>
          </div>
          <div style={{ marginBottom: '20px' }}>
            <label>
              Password:
              <input type="password" required style={{ marginLeft: '10px' }} />
            </label>
          </div>
          <div>
            <button
              type="button"
              style={{
                height: '40px',
                width: '80px',
                borderRadius: '10px',
                marginRight: '20px',
              }}
              onClick={() => window.location.href = 'Home page.html'}
            >
              Cancel
            </button>
            <button
            onClick={handlecatergory}
              style={{
                height: '40px',
                width: '80px',
                borderRadius: '10px',
              }}
            >
              Submit
            </button>
          </div>
        </div>
      </form>
    </div>
  );
};
}
export default LoginPage;
